apiVersion: apps/v1
kind: Deployment
metadata:
  name: fig1
  annotations:
    greymatter.io/inject-sidecar-to: "3000"
spec:
  selector:
    matchLabels:
      app: fig1
  template:
    metadata:
      labels:
        app: fig1
    spec:
      containers:
        - name: fig1
          image: python:3
          command:
            - python
          args:
            - -m
            - http.server
            - "3000"
